import React from "react";
import { NavLink } from "react-router-dom";
import "./SearchBarItems.scss";

const SearchBarItems = (props) => {
  return (
    <li>
      <NavLink
        className="search-item" 
        to={props.url}
        // onClick={changeShipmentInfo}
      >
        {props.name}
      </NavLink>
    </li>
  );
};

export default SearchBarItems;
